import gql from 'graphql-tag';

export const MY_PRODUCTS = gql`
query MY_PRODUCTS {
    user{
      id
      username
      email
      products{
        id
        name
        description
        price
        imageUrl
      }
    }
  }

`

export const QUERY_PRODUCTS = gql`
  query {
  products{
    id
    name
    description
    price
    imageUrl
    createdAt
    user{
      id
    }
  }
} 
`
